import React, { useState, useEffect, useCallback, useMemo } from 'react';
import { useNavigate } from 'react-router-dom';
import Categories from '../components/Categories';
import ToDoList from '../components/ToDoList';
import ToDoActions from '../components/ToDoActions';
import Navbar from '../components/Navbar';
import EditTaskPopUp from '../components/EditTaskPopUp';
import AddTaskPopUp from '../components/AddTaskPopUp';
import AddCategoryPopUp from '../components/AddCategoryPopUp';
import { fetchTasks, addTask, deleteTask, fetchUserId, fetchEmail, addCategory, fetchCategories, deleteCategory } from '../api';
import { connectWebSocket, disconnectWebSocket, sendUpdateTaskMessage } from '../websocket';
import { iconMap, customCategoryIcon } from '../icons';

function Dashboard() {
  const [showEditTaskPopUp, setShowEditTaskPopUp] = useState(false);
  const [showAddCategoryPopUp, setShowAddCategoryPopUp] = useState(false);
  const [isDeleteMode, setIsDeleteMode] = useState(false);
  const [tasks, setTasks] = useState([]);
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState(null);
  const [currentTask, setCurrentTask] = useState(null);
  const [showAddTaskPopUp, setShowAddTaskPopUp] = useState(false);
  const [userId, setUserId] = useState(null);
  const navigate = useNavigate();

  const initializeDashboard = useCallback(async () => {
    try {
      const email = await fetchEmail();
      const fetchedUserId = await fetchUserId(email);

      if (fetchedUserId) {
        setUserId(fetchedUserId);

        const fetchedTasks = await fetchTasks();
        setTasks(fetchedTasks);

        const fetchedCategories = await fetchCategories(fetchedUserId);
        // Kategorien nach `categoryId` sortieren
        const sortedCategories = fetchedCategories
          .reduce((acc, category) => {
            if (!acc.some(cat => cat.categoryId === category.categoryId)) {
              acc.push({
                ...category,
                icon: iconMap[category.name] || customCategoryIcon,
              });
            }
            return acc;
          }, [])
          .sort((a, b) => a.categoryId - b.categoryId); // Sortierung nach `categoryId`

        setCategories(sortedCategories);

        if (sortedCategories.length > 0) {
          setSelectedCategory(sortedCategories[0]);
        } else {
          setSelectedCategory(null);
        }
      } else {
        navigate('/login');
      }
    } catch (error) {
      console.error('Error initializing dashboard:', error);
      navigate('/login');
    }
  }, [navigate]);

  useEffect(() => {
    initializeDashboard();
  }, [initializeDashboard]);

  const filterTasksByCategory = (tasks, categoryId) => {
    if (!categoryId) return tasks;
    return tasks.filter(task => task.categoryId === categoryId);
  };

  const filteredTasks = useMemo(() => {
    if (!selectedCategory) return tasks;
    switch (selectedCategory.name) {
      case 'All Tasks':
        return tasks.filter(task => !task.completed);
      case 'Today':
        return tasks.filter(task => task.categoryId === selectedCategory.categoryId && !task.completed);
      case 'Planned':
        return tasks.filter(task => task.planDate !== null && !task.completed);
      case 'Any Time':
        return tasks.filter(task => task.planDate === null && !task.completed && task.categoryId === selectedCategory.categoryId);
      case 'Work':
      case 'Personal':
        return tasks.filter(task => task.categoryId === selectedCategory.categoryId && !task.completed);
      case 'Logbook':
        return tasks.filter(task => task.categoryId === 7 || task.completed);
      default:
        return tasks.filter(task => task.categoryId === selectedCategory.categoryId && !task.completed);
    }
  }, [tasks, selectedCategory]);

  useEffect(() => {
    const handleMessage = (message, onMessageReceived) => {
      if (message.body) {
        try {
          const parsedMessage = JSON.parse(message.body);
          const { sharedUserIds, userId } = parsedMessage;

          // Filtere Nachrichten basierend auf der Benutzer-ID
          if (sharedUserIds && sharedUserIds.includes(userId)) {
            onMessageReceived(parsedMessage);
          } else {
            console.log(`User ${userId} is not authorized to receive this message.`);
          }
        } catch (error) {
          console.error('Failed to parse WebSocket message:', error);
        }
      }
    };

    const handleWebSocketMessage = (message) => {
      console.log('Received WebSocket message:', message);
      handleMessage(message, (parsedMessage) => {
        const { userId: messageUserId, taskId, type, ...updatedData } = parsedMessage;

        console.log('Current userId:', userId); // Debug-Ausgabe
        console.log('Parsed Message:', parsedMessage);

        const numericTaskId = Number(taskId);
        if (isNaN(numericTaskId)) {
          console.error('taskId is not a number:', taskId);
          return;
        }

        if (type === 'TASK_UPDATE') {
          setTasks(prevTasks => {
            const taskIndex = prevTasks.findIndex(task => task.taskId === numericTaskId);
            if (taskIndex !== -1) {
              const updatedTasks = [...prevTasks];
              updatedTasks[taskIndex] = { ...prevTasks[taskIndex], ...updatedData };
              console.log('Updated tasks:', updatedTasks);
              return updatedTasks;
            } else {
              console.log('Adding new task:', { taskId: numericTaskId, ...updatedData });
              return [...prevTasks, { taskId: numericTaskId, ...updatedData }];
            }
          });
        }
      });
    };

    if (userId) {
      console.log('Connecting WebSocket for user ID:', userId);

      const fetchIds = async () => {
        try {
          const fetchedTasks = await fetchTasks();
          const fetchedCategories = await fetchCategories(userId);
          const taskIds = fetchedTasks.map(task => task.taskId);
          const categoryIds = Array.isArray(fetchedCategories) ? fetchedCategories.map(category => category.categoryId) : [];
          connectWebSocket(userId, taskIds, categoryIds, handleWebSocketMessage);
        } catch (error) {
          console.error('Error fetching IDs for WebSocket:', error);
        }
      };

      fetchIds();

      return () => {
        console.log('Disconnecting WebSocket for user ID:', userId);
        disconnectWebSocket();
      };
    }
  }, [userId]);

  const handleAddNewTask = async (newTask) => {
    if (!selectedCategory) return;

    try {
      const formattedTask = {
        ...newTask,
        categoryId: selectedCategory.categoryId,
        userId: userId
      };
      console.log("Formatted Task before sending to backend:", formattedTask);

      const addedTask = await addTask(formattedTask, userId);
      setShowAddTaskPopUp(false);

      setTasks(prevTasks => [...prevTasks, addedTask]);
      sendUpdateTaskMessage(addedTask);
    } catch (error) {
      console.error('Error adding task:', error);
    }
  };

  const handleSaveTask = async (updatedTask) => {
    try {
      const taskToUpdate = {
        ...updatedTask,
        userId: userId,
        taskId: currentTask.taskId,
        categoryId: currentTask.categoryId,
      };
      console.log("Task to Update before sending to backend:", taskToUpdate);
      setShowEditTaskPopUp(false);
      setTasks(prevTasks => {
        const updatedTasks = prevTasks.map(task => (task.taskId === taskToUpdate.taskId ? taskToUpdate : task));
        return updatedTasks;
      });
      sendUpdateTaskMessage(taskToUpdate);
    } catch (error) {
      console.error('Error editing task:', error);
    }
  };

  const handleDeleteTask = async (id) => {
    try {
      await deleteTask(id);
      setTasks(prevTasks => prevTasks.filter(task => task.taskId !== id));
    } catch (error) {
      console.error('Error deleting task:', error);
    }
  };

  const handleAddCategory = async (newCategory) => {
    try {
      const data = await addCategory(newCategory);
      const newCategoryObject = {
        categoryId: data.categoryId,
        name: data.name,
        icon: customCategoryIcon,
      };
      setCategories(prevCategories => [...prevCategories, newCategoryObject]);
      setSelectedCategory(newCategoryObject);
    } catch (error) {
      console.error('Error adding category:', error);
    }
  };

  const handleDeleteCategory = async (id) => {
    try {
      await deleteCategory(id);
      setCategories(prevCategories => prevCategories.filter(category => category.categoryId !== id));
    } catch (error) {
      console.error('Error deleting category:', error);
    }
  };

  const toggleDeleteMode = () => {
    setIsDeleteMode(prevMode => !prevMode);
  };

  const handleEditTask = (task) => {
    setCurrentTask(task);
    setShowEditTaskPopUp(true);
  };

  return (
    <div className="container mx-auto px-4 sm:px-10 lg:px-16 py-6">
      <Navbar
        onAddTask={() => setShowAddTaskPopUp(true)}
        onAddCategory={() => setShowAddCategoryPopUp(true)}
        onToggleDeleteMode={toggleDeleteMode}
        isDeleteMode={isDeleteMode}
      />
      <div className="flex flex-col sm:flex-row gap-4">
        <Categories
          categories={categories}
          onSelectCategory={setSelectedCategory}
          selectedCategory={selectedCategory}
          onDeleteCategory={handleDeleteCategory}
          isDeleteMode={isDeleteMode}
        />
        <ToDoList
          tasks={filteredTasks}
          onEditTask={handleEditTask}
          onDeleteTask={handleDeleteTask}
          isDeleteMode={isDeleteMode}
        />
      </div>
      <ToDoActions
        onAddTask={() => setShowAddTaskPopUp(true)}
        onToggleDeleteMode={toggleDeleteMode}
        isDeleteMode={isDeleteMode}
      />
      {showEditTaskPopUp && (
        <EditTaskPopUp
          task={currentTask}
          onSave={handleSaveTask}
          onClose={() => setShowEditTaskPopUp(false)}
        />
      )}
      {showAddTaskPopUp && (
        <AddTaskPopUp
          onAdd={handleAddNewTask}
          onClose={() => setShowAddTaskPopUp(false)}
        />
      )}
      {showAddCategoryPopUp && (
        <AddCategoryPopUp
          onAdd={handleAddCategory}
          onClose={() => setShowAddCategoryPopUp(false)}
        />
      )}
    </div>
  );
}

export default Dashboard;
